import RDSMonitor from './components/RDSMonitor'
import './App.css';
import {BrowserRouter as Router, Route, Link, Routes} from 'react-router-dom'

function App() {
  return (
    <div className="App">
          <Router>
          <AppRoutes></AppRoutes>
          <header className="App-header">
            <ul>
              <li><Link to="/account1">Account1</Link></li>
              <li><Link to="/account2">Account2</Link></li>
              <li><Link to="/account3">Account3</Link></li>
            </ul>
            </header>
            <Routes>
              <Route path="/account1" element={<RDSMonitor account_name="ACCOUNT1" />} />
              <Route path="/account2" element={<RDSMonitor account_name="ACCOUNT2" />} />
              <Route path="/account3" element={<RDSMonitor account_name="ACCOUNT3" />} />
            </Routes>
          </Router>
    </div>
  );
}

const AppRoutes = () => {
  const navigate = useNavigate(); // react-router-dom v6

  useEffect(() => {
    if ($stateParams.redirect) {
      if ($stateParams.param1 && $stateParams.param2) {
        navigate(
          `/account${$stateParams.param1}`
        );
      }
    }
  }, []);

  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/decider-route/:param1/:param2 " element={<Component />} />
    </Routes>
  );
};

export default withRouter(App);
